import React from "react";
import sprite from "../../images/sprite.svg";
import s from "./Home.module.scss";

export const Home = () => {
  return (
    <div className={s.container}>
      <svg>
        <use href={`${sprite}#logo`} />
      </svg>
      <img src={`${sprite}#logo`} alt="logo" className={s.logo} />
      <p>Finance </p>
    </div>
  );
};
